message:
RECEBI DE UM GRUPO CRISTÃO E MILITAR E REPASSO: 

Ações que a "direita burra" passou a praticar com frequência:

- xingar os militares;
- sair dos QGs porque 68 dias de resistência foram suficientes; 
- chega de manifestação pacífica, agora é guerra;
- agora ficou perigoso no QG;
- vão cear o Natal tranquilo porque a Intervenção já começou; 

Isso  não podia terminar bem. Não adianta colocar a culpa em alguém.  A culpa é de cada um que não buscou conhecimento, e de cada um que recebeu o conhecimento e negou divulgar. 
O Titanic já começou a ficar de pé... a hora que afundar, já era. 

Neste canal tem uma universidade de informações. Pesquisem. 

A única solução é povo nas Portas dos Quartéis.
